import React from 'react';
import Card from './Card';
// import {nbaPlayers} from './nbaPlayers';


const CardList = (nbaPlayers) => {

const cardArray = obj.map( (val, ind) => {return
(<Card rank={val[ind].rank} name={val[ind].name} team={nbaPlayers[ind].team} />)} );

return(
   <div>
      <Card rank={nbaPlayers[0].rank} name={nbaPlayers[0].name} team={nbaPlayers[0].team} />
      <Card rank={nbaPlayers[1].rank} name={nbaPlayers[1].name} team={nbaPlayers[1].team} />
      <Card rank={nbaPlayers[2].rank} name={nbaPlayers[2].name} team={nbaPlayers[2].team} />
   </div>
)

}

export default CardList;
